import { Modal } from "react-bootstrap";

const AddNoteDialogue = () => {
  return (
    <Modal show>
      <Modal.Header closeButton>
        <Modal.Title>Add Note</Modal.Title>
      </Modal.Header>
    </Modal>
  );
};

export default AddNoteDialogue;
